import styled from "styled-components";

export const Header = styled.h1`
  text-align: center;
  color: rgb(41, 37, 37);
`;

export const CreateAccountLabelForInput = styled.label`
  display: inline-block;
  text-align: left;
  margin-bottom: 10px;
`;

export const ErrorText = styled.p`
  font-size: 10px;
  color: red;
`;

export const CreateAccountButton = styled.input`
  display: flex;
  flex: auto;
  justify-content: center;
  height: 46px;
  background-color: #42c41a;
  border: none;
  color: white;
  margin: 20px 0;
  border-radius: 3px;
`;

export const CreateAccountFormContainer = styled.div`
  width: 700px;
  display: flex;
  flex-wrap: wrap;
  flex: auto;
`;

export const ContainerForCreateAccountFormContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 100px;
  flex-direction: column;
  align-items: center;
`;

export const InputErrorColor = styled.input`
  border-bottom: 1px solid red;
  background-color: rgba(255, 0, 0, 0.171);
`;

export const InputNormalColor = styled.input`
  height: 46px;
  width: 323px;
  border-radius: 3px;
  border: 1px solid silver;
`;

export const LabelAndInputRow = styled.div`
  display: flex;
  flex-direction: column;
  padding: 10px 0;
`;

export const LabelAndInputRowContainer = styled.div`
  display: flex;
  flex: 1;
  flex-wrap: wrap;
  justify-content: space-between;
`;

export const LinkForLogin = styled(Link)`
  color: red;
`;
